import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';
const Mynotes = () => {
    return (
        <>
            <div className="container">
                <h1>Title</h1>
                <br />
                <p>content</p>
                <Button className="btn">
                    <DeleteIcon />
                </Button>
            </div>
        </>
    );
}

export default Mynotes;
